function A() {
    //변수, 함수 등을 정의
    const css1={color:"green", fontSize : '2em'}

    // function B(){alert(1);} //유명함수
    // const B = function(){alert(1);} //무명함수
    // const B = () => alert(1); //화살표함수

    return (
        <div>
            <h1>결과입니다.</h1>
            <ul style={css1}><li>리스트1</li><li>리스트2</li><li>리스트2</li></ul>
            <button><h3>클릭</h3></button>
        </div>
    );
}

export default A;
